
def start_date_analysis():
    count_dict = dict()
    with open('start_time_result') as f:
        i = 0
        for line in f.readlines():
            if i % 2 == 1:
                st = int(line.split(' ')[0])
                if st not in count_dict:
                    count_dict[st] = 1
                else:
                    count_dict[st] += 1
            i += 1
    print(count_dict)

def features_analysis(feature_result):
    count_dict = dict()
    with open(feature_result) as f:
        i = 0
        for line in f.readlines():
            if i % 2 == 1:
                st = line.split(', ')[3]
                if st not in count_dict:
                    count_dict[st] = 1
                else:
                    count_dict[st] += 1
            i += 1
    print(count_dict)

